# Borsa

Implementare e testare la classe `Purse` come collezione di `Coin`:

- una moneta è un’istanza della classe `Coin`;
- gli oggetti di Coin sono immutabili e hanno gli attributi `name` (nome della moneta) e `value` (valore della moneta);
- deve essere possibile recuperare l’informazione contenuta in ogni oggetto `Coin`;
- oltre ai metodi visti a lezione (`find`, `count`, `getMinimum`, `getMaximum`, `getTotal`), implementare anche:
    - `remove(Coin coin)`: rimuove una moneta di valore pari a `coin` se presente nella borsa;
    - `hasCoin(Coin coin)`: vale `true` se e solo se una moneta di valore pari a `coin` è presente nella borsa.

La borsa può contenere:

- `Dollar` dal valore di `1`;
- `Quarter` dal valore di `0.25`;
- `Dime` dal valore di `0.10`;
- `Nickel` dal valore di `0.05`;
- `Cent` dal valore di `0.01`;

Aggiungere alla classe `Purse`

- un metodo `toString` che restituisca una stringa:
    - `Purse[Dollar = $, Quarter = q, Dime = d, Nickel = n, Cent = c]`
    - dove `$`, `q`, `d`, `n`, `c` sono rispettivamente il numero di dollari, quarti, dime, nickel e cent contenuti
      nella borsa.
- un metodo `equals` che rispecchi la relazione di uguaglianza per la quale due borse sono uguali se e solo se
  contengono lo stesso assortimento di monete

# Libreria

Una libreria ha deciso d'informatizzare il proprio archivio delle giacenze.
Si è creato un file in cui, per ogni libro disponibile in magazzino, ci sono i seguenti elementi:
- titolo del libro;
- autore;
- editore;
- numero di copie disponibili.

Estendere la soluzione prevedendo anche audiolibri che oltre alle informazioni dei libri possiedono una durata e un formato audio.

La libreria ha la necessità di effettuare le seguenti operazioni:
- cercare tutti i libri di un particolare autore;
- cercare tutti i libri che contengono una determinata stringa nel titolo;
- cercare tutti i libri che hanno il numero di copie massimo;
- elencare tutti i libri per cui il numero di copie disponibili è al di sotto di una determinata soglia.

Implementare e testare la libreria. In particolare occorre avere questi test:
- leggere da un file contenente i dati dei libri o audiolibri;
- visualizzare i libri o audiolibri scritti da Camilleri;
- visualizzare i libri o audiolibri che hanno la parola “sogni” nel titolo;
- visualizzare i libri o audiolibri con il numero massimo di copie;
- visualizzare i libri o audiolibri per cui siano disponibili meno di 15 copie.

# Storia Finanziaria

Si definisca una classe `FinancialHistory` le cui istanze conservino informazioni relative alla gestione di un bilancio.
La classe deve fornire i seguenti costruttori e metodi:

- un costruttore con argomento `double` e un oggetto `Person` che rappresenti l'ammontare iniziale a disposizione e
  l’utente a cui si riferisce il bilancio;
- un metodo `void receiveFrom(int amount, String source)` che registri una nuova entrata di `amount` ricevuta
  da `source` (ad esempio, `"stipendio"`);
- un metodo void `spendFor(int amount, String reason)` che registri una nuova uscita di `amount` spesa per `reason` (ad
  esempio, `"affitto"`);
- un metodo `double cashOnHand()` che restituisca l’`amount` disponibile;
- un metodo `double totalReceivedFrom(String source)` che restituisca il totale delle entrate ricevute da `source`;
- un metodo `double totalSpentFor(String reason)` che restituisca il totale delle uscite spese per `reason`;
- un metodo che stampi entrate e uscite, includendo `source` o `reason` e `amount`.

NB: le liste delle entrate e delle uscite possono essere implementate utilizzando una `List` e creando un’unica
classe `Movement` contenente al suo interno una stringa `description` e l’`amount`.
Un’entrata sarà rappresentata da un `Movement` con `amount` positivo, mentre un’uscita avrà un valore negativo.

Si trattino con eccezioni delle seguenti situazioni:
- "bilancio in rosso" nel costruttore (i.e., imposta il saldo in negativo);
- "bilancio in rosso” (cioè si tenta di spendere più di quel che si ha).

Implementare i casi di test per collaudare il tutto.
